import React from "react";
import Head from "next/head";
import { Form } from "antd";
import AppLayout from "../components/AppLayout";

const signup = () => {
  return (
    <AppLayout>
      <Head>
        <title>SignUp Page | NodeBird</title>
      </Head>
      <AppLayout>
        <div>Signup Page</div>
      </AppLayout>
    </AppLayout>
  );
};

export default signup;
